import React, { Component } from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import CustomDialogInvestor from "../layout/form/CustomDialogInvestor";

const styles = {
  card: {
    minWidth: 275
  },
  title: {
    fontSize: 14
  },
  pos: {
    marginBottom: 12
  }
};

class InvestorCard extends Component {
  handlecards = props => {
    return <CustomDialogInvestor  company={props.company} />;
  };
  render() {
    const { classes } = this.props;
    return (
      <Card className={classes.card}>
        <CardContent>
          <Typography className={classes.title}>
            <Button>{this.handlecards}</Button>
            Status: {this.props.company.status}
          </Typography>
          <Typography>{this.props.company.nameInEnglish}</Typography>
          <Typography className={classes.pos} color="textSecondary">
            {this.props.company.addressHQ}
          </Typography>
        </CardContent>
        <CardActions>
          {this.handlecards}
        </CardActions>
      </Card>
    );
  }
}

export default withStyles(styles)(InvestorCard);
